"text-align&#58;justify;\"><span><span><span><b><span><span>Green PAC iLab startte ooit als incubator, om jonge ondernemingen die zich focusten op (groene) kunststoffen op weg te helpen. Inmiddels richt de Zwolse incubator zich ook op start-ups binnen de bredere maakindustrie. En daar hoort een nieuwe naam bij. Tijd dus om een punt achter Green PAC iLab te zetten én een punt te maken onder én met een nieuwe naam&#58; ZWINC. – dé plek in de Regio Zwolle ‘where ideas grow into business’. Punt.</span></span></b></span></span></span></p><p style=\"text-align&#58;justify;\"><span><span><span><span><span>De lancering vond vrijdag plaats in Zwolle. Onze hogeschool is initiatiefnemer en collegelid Inge Grimm benadrukte dat ZWINC een belangrijke bijdrage levert aan het verder verbeteren en versterken van het start-up-klimaat in Regio Zwolle&#58; “ZWINC staat voor Zwolle Incubator, maar ik herken er ook het woord ‘winnen’ in, wat staat voor de ambitie om nog meer start-ups vooruit te helpen in de maakindustrie. En – ik blijf in eerste instantie een Windesheimer – toch ook de ‘Win’ van Windesheim. Want vanuit onze hogeschool zetten we actief in op het creëren van een gunstig start-up-klimaat in onze regio. Dat biedt perspectief voor studenten met echte ondernemerschapsambities én voor onze regionale (kennis)economie. Met de nieuwe naam ZWINC gaan we als dé incubator voor oud-studenten van zowel Windesheim als daarbuiten vanaf nu volop voor een plek in de top 10 van start-up-regio’s in Nederland.” </span></span></span></span></span></p><p style=\"text-align&#58;justify;\"><span><span><span><b><span><span>1.300 vierkante meter aan inspiratie</span></span></b></span></span></span></p><p style=\"text-align&#58;justify;\"><span><span><span><span><span>“Een plek waar ideeën uitgroeien tot ondernemingen, dat is ZWINC”, vertelt manager Bastian Coes. “Als team hebben we ons twee jaar lang keihard ingezet om de ondersteuning en huisvesting voor start-ups te realiseren. Dat hebben we niet alleen gedaan, maar in nauwe samenwerking met onze partners Windesheim, de gemeente Zwolle, provincie Overijssel en Kennispoort.” Het resultaat mag er zijn. De oude fabriekshal van Philips is inmiddels de thuisbasis geworden van ZWINC. Een inspirerende locatie met 1.300 vierkante meter aan prachtige werkplekken, een 3D-Printlab, vergader- en brainstormruimte en een state-of-the-art machinepark.</span></span></span></span></span></p><p style=\"text-align&#58;justify;\"><span><span><span><b><span><span>Dé plek voor energieke start-ups</span></span></b></span></span></span></p><p style=\"text-align&#58;justify;\"><span><span><span><span><span>Bij ZWINC krijgen startende ondernemers laagdrempelig toegang tot het verkennen van hun ondernemerskwaliteiten om zo, in drie jaar tijd, door te groeien van (zoekende) starter naar (zelfbewuste) ondernemer. Een voorbeeld van zo’n start-up die door Green PAC iLab – nu dus ZWINC. – al flink aan de weg timmerde is </span></span><a data-cke-saved-href=\"https&#58;//www.forest-living.com/\" href=\"https&#58;//www.forest-living.com/\"><span><span>Forest Living</span></span></a><span><span>. De bedenkers en oprichters Boy Rolloos en Johan Fluit wilden betaalbare en energieneutrale woningen standaardiseren, produceren en automatiseren. Dit deden zij door woningen modulair te bouwen en te ‘LEGOliseren’. En dit leverde het tweetal onder meer een succesvol bedrijf én de titel Starter van het Jaar Regio Zwolle 2020 op.</span></span></span></span></span></p><p style=\"text-align&#58;justify;\"><span><span><span><span><span>Maar ook Jules van Haaren en zijn compagnon Jelle Hilarius bouwen bij ZWINC hun bedrijf </span></span><a data-cke-saved-href=\"https&#58;//www.destentor.nl/zwolle/jelle-31-uit-zwolle-bedenkt-oprolbaar-zonnetapijt-ineens-viel-het-kwartje~a8e9c852/\" href=\"https&#58;//www.destentor.nl/zwolle/jelle-31-uit-zwolle-bedenkt-oprolbaar-zonnetapijt-ineens-viel-het-kwartje~a8e9c852/\"><span><span>Wattage</span></span></a><span><span> verder uit. De start-up ontwikkelt duurzame energieoplossingen voor de openbare ruimte. Het eerste product was het Zonnetapijt&#58; een flexibel oprolbaar zonnepaneel dat over sportvelden rolt op het moment dat er niet gesport wordt. In hun eigen ZWINC-cubicle testen de jonge ondernemers nu hoe vaak je dit tapijt kunt op- en uitrolllen voordat het stuk gaat.</span></span></span></span></span></p><p style=\"text-align&#58;justify;\"><span><span><span><b><span><span>Sterke link met kennis én de regio</span></span></b></span></span></span></p><p style=\"text-align&#58;justify;\"><span><span><span><span><span>Een ander uniek punt van ZWINC is de zeer sterke link met kennis. Niet alleen is de locatie fysiek aangepakt, maar er is ook ingezet op een nog beter passend coach- en kennisaanbod. Zo zijn er ondertussen meerdere lectoraten van de hogeschool en kennispartners aangehaakt. De start-ups profiteren van deze kennis en de regio weer van al deze start-ups, zo benadrukt de Overijsselse gedeputeerde Eddy van Hijum&#58; “Start-ups zijn onmisbaar in de regio. Ze dragen niet alleen bij aan een vitale en gezondere economie, maar zorgen ook voor het versnellen van de noodzakelijke transitie naar een circulaire economie.” Wethouder René de Heer is het daar mee eens. “De start-ups die ZWINC ondersteunt en begeleidt dragen niet alleen bij aan een beter ondernemersklimaat, maar dragen ook bij aan de doorontwikkeling van de maakindustrie in Regio Zwolle.”</span></span></span></span></span></p><p style=\"text-align&#58;justify;\"><span><span><span><b><span><span>De start-ups centraal</span></span></b></span></span></span></p><p style=\"text-align&#58;justify;\"><span><span><span><span><span>Start-ups zijn het kloppend hart van ZWINC. Zonder hen geen ZWINC. Bastian Coes&#58; “Kijk ik om me heen dan zie ik bij de start-ups die we ondersteunen dat ze zich vol inzetten om hun dromen na te jagen. En dat doen ze vol overgave waarbij ze enorm hard werken, zich telkens opnieuw uitvinden en blijven doorzetten. En daarin ondersteunen wij. We bieden start-ups de tools, kennis, coaching en ondersteuning die ze nodig hebben om zich te ontwikkelen. Binnen ZWINC zien we de start-ups als hét middelpunt. Om hen draait het allemaal, zij staan centraal.”</span></span></span></span></span></p><p style=\"text-align&#58;justify;\"><span><span><span><b><span><span>Meer informatie</span></span></b></span></span></span></p><p style=\"text-align&#58;justify;\"><span><span><span><span><span>Ben jij een studentondernemer? Dan kun je bij het </span></span><a data-cke-saved-href=\"https&#58;//www.windesheimcentreforentrepreneurship.com/\" href=\"https&#58;//www.windesheimcentreforentrepreneurship.com/\"><span><span>Windesheim Centre for Entrepreneurship</span></span></a><span><span> aankloppen. Zit jij al in de volgende fase van je onderneming die zich richt op de maakindustrie, kijk dan eens op de website van ZWINC&#58;&#160;</span></span></span></span></span><span><span><span><b>&#160;</b></span></span></span><span><span><span><a data-cke-saved-href=\"https&#58;//zwinc.nl/\" href=\"https&#58;//zwinc.nl/\" title=\"https&#58;//zwinc.nl/\" data-interception=\"on\">https&#58;//zwinc.nl/</a></span></span></span></p><p style=\"text-align&#58;justify;\"><a data-cke-saved-href=\"https&#58;//youtu.be/UlFK5lGiXQo\" href=\"https&#58;//youtu.be/UlFK5lGiXQo\">https&#58;//youtu.be/UlFK5lGiXQo</a></p></div></div><div data-sp-canvascontrol=\"\" data-sp-canvasdataversion=\"1.0\" data-sp-controldata=\"&#123;&quot;position&quot;&#58;&#123;&quot;zoneIndex&quot;&#58;1,&quot;sectionIndex&quot;&#58;1,&quot;controlIndex&quot;&#58;2,&quot;layoutIndex&quot;&#58;1,&quot;sectionFactor&quot;&#58;8&#125;,&quot;controlType&quot;&#58;3,&quot;id&quot;&#58;&quot;7d081723-adfe-4954-9457-480ff8662a24&quot;,&quot;webPartId&quot;&#58;&quot;544dd15b-cf3c-441b-96da-004d5a8cea1d&quot;,&quot;emphasis&quot;&#58;&#123;&#125;,&quot;reservedHeight&quot;&#58;479,&quot;reservedWidth&quot;&#58;803,&quot;addedFromPersi